{"8": ["Бестолковая штука. Глину можно разминать часами, но толку так и не прибавится. Пробовали сделать отпечаток в 2 месяца, не вышло. Решили попробовать в 4. Кроме пятки и нескольких пальцев ничего не отпечаталось. Скорее всего набор для ребенка, который сам сможет всем своим весом наступить. Тогда что то отпечатается. ", "2021-03-22T11:45:11Z", "белый", "0", 1, 0, 1, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "9": ["Дорого конечно за 3 соединенные рамочки. Жаль что в боковых нет защитного стекла, пылиться будет", "2021-03-19T12:02:31Z", "черный, белый", "0", 0, 1, 4, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "10": ["Качество не очень, хлипенькая. Для раскатки теста почему то нет в комплекте скалки", "2021-03-16T12:50:39Z", "белый", "0", 1, 0, 4, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "17": ["Берём этой фирмы 2й раз уже. 1й раз брали 5, 5 лет назад. И хотели чтоб у младнего ребёнка был или такой же набор, или максимально похожий.\n Все супер, довольны. Пришлось повозиться со слепком ручки... Но это ребёнок и ему не объяснишь что так надо)))\nКачество хорошее, сроки и сама глина хорошая. ", "2021-03-04T19:45:42Z", "белый", "0", 1, 0, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "22": ["Очень классная рамка. Размеру соответствует , целая и крепкая. Слепки делать легко.", "2021-02-22T20:17:40Z", "белый", "0", 2, 0, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "26": ["Как и многие столкнулись с проблемой сделать слепок. Казалось бы что сложного, следуя инструкции: «размять и приложить». А на самом деле нужно вдавливать с силой, чего естественно делать не будешь, чтобы хоть как-то остался отпечаток. В итоге нужно либо самому доделывать слепок, либо смириться с результатом. Можно только похвалить рамку. Стоимость не оправдана.", "2021-02-06T22:12:35Z", "белый", "0", 1, 0, 3, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "27": ["Прочитала отзывы и очень переживала. Не разделяю негативных комментариев, пришло все целое и хорошо упаковано, рамка вполне себе нормальная, материал для отпечатков мягкий и приятно пахнет, минут 10 разминали (читай инструкцию), получилось с первого раза, лишнее обрезала ножницами и материала хватило сделать отпечаток второй ручки (ребёнку 3 мес). На рамках для отпечатков действительно нет стёкол, но их там и не должно быть, отпечаток ведь объемный, при проявлении фантазии можно придумать, как защитить слепок от пыли. У нас за 48 часов все высохло, мы остались довольны. И при высыхании ничего не сгладилось.", "2021-02-05T11:04:05Z", "черный, белый", "0", 1, 0, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "31": ["Ставлю только одну звезду.\nСама рамка хлипенькая.\nА материал на котором делать отпечатки просто ужас. Сделали все по инструкции (только решили делать не круглые, а во всю рамку).\nВ итоге, оставили засыхать отпечатки, а по мере высыхания все наши отпечатки сгладились!\nУжасно.\nНа фотках рамка уже с отпечатками, которые испарились.\nНе стоит своих денег.", "2021-01-31T17:09:46Z", "белый", "0", 1, 0, 1, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "35": ["Пришло вообще не то ,верните деньги ,ужасно очень сильно разочаровалась ,долго ждала и ещё не то отправили!!!", "2021-01-20T10:54:58Z", "белый", "0", 1, 0, 1, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "36": ["Честный отзыв! Когда открыла коробку , первое впечатление было плохое , так как рамка очень хлипкая . Ощущение, что если один разложишь то сломается . Но звезду снимать не буду . Масса для слепка мягкая , пару раз переделывала отпечаток , так как с первого раза не получилось. Потом обрезала лишнее по краям канцелярским ножом , положила в шкаф высохнуть на 48 часов . Не чего не треснула , массу отклеила от доски так же ножом . Купили краску дополнительно и покрасила слепки, чтоб была изюминка . В целом идея хорошая , цена думаю завышена конечно , так как качество рамки оставляет желать лучше . Мне пришла без царапин и это радует . Стоит ли заказывать ? Я думаю что можно заказать для себя , для подарка не советую . Фото прилегаю с краской и без краски , может кому то понравится ", "2021-01-16T17:28:25Z", "белый", "0", 3, 0, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "40": ["Заказала для своего малыша такую рамку. Рамка пришла с царапиной, обидно, но решила оставить, закрасила черным лаком, это не помогло, в общем пришлось наклейками украсить рамку. Масса для лепки мягкая, не знаю у кого она твёрдая, но по моему мнению она нормальная. Слоность была в одном, у малыша тонус и надо было разжать ручку, получилось не с первого раза. Качество рамки конечно точно не на 5, обычная дешёвая рамка, своих денег не стоит. ", "2021-01-02T17:45:08Z", "черный, белый", "0", 1, 0, 4, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "41": ["Глина твердая, трехмесячному малышу сделать нормальный слепок ручки не получилось. Еще и треснула при высыхании.", "2020-12-20T04:51:47Z", "белый", "0", 1, 0, 2, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "42": ["Жалко что дома рассмотрела получше. Рамка маленькая. Качество плохое. Масса хоть и мягкая но отпечатки плохо отпечатываются", "2020-11-23T21:48:09Z", "белый", "0", 3, 1, 3, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "45": ["Рамка пришла с трещиной. Да и само качество оставляет делать лучшего", "2020-11-19T18:38:31Z", "белый", "0", 1, 0, 2, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "51": ["Товар пришел целый, только не упакован не во что, массу пока не открыла, потом отзыв дополню!", "2020-10-27T11:40:19Z", "белый", "0", 1, 1, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "53": ["Зря я не послушала отзыв девушки о том, что масса сложно разминается и очень тугая. Ножку кое как прижали, а ручку так и не сделаем никак 3 мес малышу. Ждём с двух месяцев. Не рекомендую. И сама рамка не очень качественная ", "2020-10-27T22:02:10Z", "белый", "0", 4, 0, 1, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "55": ["Пришло быстро, полный комплект, без повреждений! Соответствует картинке, чёрный цвет классно смотрится! Всем советую", "2020-10-19T16:49:32Z", "черный, белый", "0", 2, 0, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "60": ["Все получилось! Спасибо!", "2020-09-23T16:24:47Z", "белый", "0", 0, 1, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "61": ["Классная рамка, слепки немного по другой технологии, но без такого оформления получилось бы совсем не то. Спасибо производителю!!!", "2020-09-12T17:55:29Z", "черный, белый", "0", 13, 0, 5, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "62": ["Рамка в принципе хорошая, но отпечатка четкого сделать не могу. Вроде все по инструкции делаю. Очень рассроена☹️ ", "2020-08-30T14:08:52Z", "белый", "0", 1, 0, 4, "Фоторамка для создания слепка (отпечатка) ручки и ножки \"ПЕРВЫЙ СЛЕД МАЛЫША\" Безвредная масса.", "REDREI"], "63": ["Рамка пришла целая,