создания слепка (отпечатка) ручки и ножки.", "REDREI"], "71": ["Рамка по качеству конечно далеко не на 1000 р. Однако в целом все неплохо. Масса мягкая, пластичная. Ручку годовалому сделали нууу с 5 попытки. Ножку вообще сразу. Довольна в целом покупкой. \nИз минусов: складывается в ней только 1 створка. Взять и полностью сложить ее (при переезде например) не получится. Так что коробку от нее лучше не выбрасывать))", "2020-07-13T10:32:00.135734685Z", "белый", "0", 0, 1, 4, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "72": ["У нас все получилось и не треснуло. Стекло теперь имеется у этой рамочки. Красота и на память отлично", "2020-07-10T08:05:57.935450075Z", "белый", "0", 3, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "73": ["Не получилось сделать. Надо с огромной силой давить на ручку малыша. Попробовала свою руку, то же самое. Очень твердый материал, не проминается. Рамка хлипкает. Впустую потраченные деньги", "2020-07-04T15:09:03.804211019Z", "черный", "0", 1, 1, 1, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "78": ["Купила этот набор только ради рамки, нужна была тройная, а слепки были сделаны из другой смеси. Поэтому отзыв мой о рамке. В общем-то она на троечку - «стекло» не стекло вовсе, а какие-то пластиковые штуки. Слепки надо делать тонюсенькими, чтобы они поместились между пластиковым и задним (фанерным) креплением. Либо клеить поверх пластика, но их легко испортить, сломать, плюс выцветут. Ладно хоть сама рамка не сломана, не поцарапана 😏 Но смотрится красиво))", "2020-06-16T18:02:08.900563714Z", "белый", "0", 2, 0, 3, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "80": ["Получила в целости и сохранности, очень понравился набор. Огромное спасибо WB", "2020-06-11T08:18:17.956691976Z", "белый", "0", 2, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "81": ["Рамка для фотографий хорошая. Но для создания отпечатков к сожалению материал не очень. Возможно для больших деток подойдёт, сила нажатия. А для младенцев не вариант. Плотный гипс, нет возможности надавить сделать слепок. Поэтому не советую для малышей", "2020-06-04T16:14:43.327612908Z", "белый", "0", 3, 0, 3, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "83": ["Качество рамки отвратительное! Пришла в запечатанной упаковке. ", "2020-05-29T03:47:00.324234047Z", "черный", "0", 1, 0, 1, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "85": ["Еще не пробовали делать слепки,но качество самой рамки оставляет желать лучшего. Думаю в фикс прайсе можно купить качественнее вещь( цена-качество как-то не особо совпадает, увы(", "2020-05-25T12:08:10.830538322Z", "белый", "0", 2, 0, 2, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "86": ["Хороший наборщик, упакован отлично!", "2020-05-11T06:50:42.101294551Z", "белый", "0", 1, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "88": ["Вайлдберриз вы в своем уме? Заказала на подарок двойняшкам рамки, забрала сестра в другом городе, открыла и расстроилась. Одна рамка пришла в нормальном качестве, вторая вся потертая, без пупырчатых перегородок, вся поцарапанная. Какого черта вы отправляете такой товар? За что я плачу деньги? За брак? Списывайте такие товары, возвращайте производителю в конце концов, если вам возвращают что-то испорченное. У меня просто волна возмущения!!!!! Вы испортили весь настрой от подарка еще и приходится к вам ходить по несколько раз. Тьфу просто.", "2020-05-07T11:58:41.60709627Z", "черный", "0", 2, 0, 1, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "90": ["У нас получилось отлично", "2020-04-23T19:39:32.471495705Z", "белый", "0", 3, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "91": ["Покупала в подарок , полностью соответствует описанию , упаковка в хорошем состоянии все закрыто и новое . Из всех подобных товаров что я искала, этот вариант самый приятный по цене, остальные намного дороже или плохого качества . Рамки со слепками не предполагают стекла , но это не беда, при желании можно купить дешёвые рамки или воспользоваться уже имеющимися дома рамками и оттуда позаимствовать стекло. Обладательница довольна подарком полностью. ", "2020-04-09T06:58:18.578010186Z", "белый", "0", 2, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "93": ["Хорошая рамка все соответствует", "2020-04-02T11:38:23.340621044Z", "белый", "0", 1, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "94": ["Купила набор, сделали слепки. Все как всегда отлично! Эту же фирму брала для слепка 10 лет назад! Стоит рамочка, не потрескалась, не сломалась! Всем советую! Если с первого раза не получился отпечаток, можно делать до получения желаемого результата! Сейчас делала слепок ребёнку 1 г. 5 месяцев. ", "2020-04-01T09:06:22.958180843Z", "белый", "0", 1, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "96": ["Очень классная рамка . Следы получились не с первого раза из-за того что делала сама с ребенком,если кто-то будет держать кроху,а второй человек надавливать на ручку,ножку можно и с первого раза справиться. Советую руки смочить в воде прежде чем разминать и раскатывать скалкой по доске .", "2020-03-26T13:31:04.017875536Z", "белый", "0", 2, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "98": ["Только открыла, прям сразу же вопрос: \"обрежьте в виде овала ножом\" -это я должна на глаз форму овала придавать??? Почему нельзя эту форму было в комплект положить, прям сразу этот момент не понравилсч, сейчас буду делать, отзыв дополню", "2020-03-05T11:20:53.557224934Z", "белый", "0", 5, 4, 3, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "100": ["Пришло быстро, все в хорошем состоянии. Коробка целая, в подарок очень хорошо. Рекомендую. ", "2020-03-04T12:35:28.256220114Z", "черный", "0", 1, 1, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "101": ["Комплектность целая👍 если бы рамка была со стеклом, было бы просто отлично. Массу для лепки перед началом необходимо размять смоченными руками, тогда все получится ))) Наш отпечаток ручки уже готов😃 ножку будем делать с помощью папы🙃 Ребёнку 6 месяцев", "2020-03-03T10:01:03.337930792Z", "белый", "0", 5, 0, 4, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "102": ["Всё отлично.Упаковка целая,всё на месте.Качество хорошее.", "2020-02-25T18:03:27.52392522Z", "белый", "0", 2, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "103": ["Как я намучилась с этой рамкой. Минус первый нет стёкла, минус второй очень твёрдая масса. Я переделывала это просто не счесть сколько раз. Ребёнку очень было сложно отпечатать ручку. Пришлось очень сильно нажимать. Ребёнок расплакался. След не четкий. Не знаю как это засохнет((( но и я и ребёнок просто испытали стресс. У старшей все было на много лучше! ", "2020-02-24T14:15:17.285211696Z", "черный", "0", 2, 0, 2, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "104": ["Отличная рамочка.  Ножку с ручкой пришлось сильно надавливать в смесь, чтобы получился отпечаток хороший. У нас получилось раза с 10) , но в итоге все понравилось. Обязательно , когда обрежите слепок нужно пройтись водой по краям. Ничего не треснуло. Единственное не понравилось, что нет стекла, будут пылиться, а со временем возможно и отвалятся. У старшего ребёнка со стеклом слепки , так удобнее и практичнее, здесь сразу не обратила внимания. ", "2020-02-17T10:32:43.842091696Z", "белый", "0", 2, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "105": ["Отличный подарок для нашей бабушки. Все хорошо упаковано, в этой же коробке отправили подарочек бабушке. Слепки получились, ничего не потрескалось. Смесь готовая(это очень порадовало), края можно спокойно выровнять мокрыми руками. Единственно нужно хорошо надавить, чтобы получился хороший слепок.", "2020-01-22T06:17:26.266486476Z", "черный", "0", 3, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "107": ["Рамка не плохая, но отсутствуют стекла на рамках где слепки, будет пачкаться, пришлось отказаться ((", "2020-02-16T07:24:21.602262026Z", "белый", "0", 1, 0, 3, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "110": ["Хорошая рамка,отличная семесь для слепков, ничего не потрескалось. Совет: не раскатывайте тонко гипс, она поэтому и лопается у многих. ", "2020-01-28T13:54:22.032797871Z", "белый", "0", 2, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "112": ["Не знаю, у кого что не получается, у нас все вышло очень красиво и хорошо. Правда делать удобнее вдвоём, но это наверное кто как приноровится.  Сначала боялась заказывать из-за отзывов, но по итогу заказом довольна.", "2019-12-24T04:18:13.244040373Z", "белый", "0", 7, 0, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "114": ["Деньги на ветер !!! Ужас сильно расстроена !!! ", "2019-11-28T13:27:10.911048269Z", "белый", "0", 0, 2, 1, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "116": ["Все пришло целое. Масса при раскатывании трескается, после того, как вымесила его, раскаталось отлично и отпечаток тоже делается очень хорошо. Но после высыхания края трескаются. Возможно это решится, если раскатать потоньше или обрезать не сразу, как я. Но как тогда обрезать после высыхания? Похоже на гипс, раскрошится. У старшего сына похожая рамка другой фирмы (дороже), там отличная пластичная масса была и ничего не трескалось.", "2019-11-15T13:48:49.733680287Z", "черный", "0", 3, 0, 4, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"], "117": ["Отличная фоторамка, пришло все целое, спасибо!!!! Рекомендую к покупке)))", "2019-11-13T12:43:08.964165756Z", "белый", "0", 6, 1, 5, "Фоторамка \"Первый след малыша\" для создания слепка (отпечатка) ручки и ножки.", "REDREI"]}
